import { useState } from "react";

export default function Login() {
  return (
    <main>
      <form>
        <h1>Soy un login page</h1>
        <input
        type="text"
        placeholder="username"
        />
        <input
        type="password"
        placeholder="password"
        />
        <button>Registrarse</button>
      </form>
    </main>
  );
}
